The Condemmed: Vengeance Is A Bitch [SPLIT SCENES]


Cast
Kagney Linn Karter, Kimberly Kane, Krissy Lynn, Meggan Mallone, Nikki Jayne, Tory Lane, Vanessa Leon



Jesse is a fighter who is kidnapped and taken to an abandoned building where she is indoctrinated into a group of female vigilantes who exact a brutal justice on men who commit crimes against women and get away with it. Jesse is reluctant to join them, but eventually she sees the wisdom in their ways...until the day their next victim is Jesse's last love. And then Jesse must make the ultimate choice...between love and lust, and crime and punishment. B. Skow has created a masterwork that has been labeled a &quot;modern classic.&quot; With no less than 11 sex scenes, four anals, a DP, and two of the hottest Vivid girls to ever grace an adult camera.
